import React from "react";
import { Select } from "antd";

interface SelectRickProps {
  onSearch: (value: string, type: string) => void;
}

const SelectRick: React.FC<SelectRickProps> = ({ onSearch }) => {
  const handleStatusChange = (value: string) => {
    onSearch(value, "status");
  };

  const handleGenderChange = (value: string) => {
    onSearch(value, "gender");
  };

  return (
    <div>
      <Select
        defaultValue="Status"
        style={{ width: 200 }}
        onChange={handleStatusChange}
        options={[
          {
            label: "Status",
            options: [
              { label: "Alive", value: "alive", key: "status-alive" },
              { label: "Dead", value: "dead", key: "status-dead" },
              { label: "Unknown", value: "unknown", key: "status-unknown" },
            ],
            key: "status-options",
          },
        ]}
      />
      <Select
        defaultValue="Gender"
        style={{ width: 200 }}
        onChange={handleGenderChange}
        options={[
          {
            label: "Gender",
            options: [
              { label: "Male", value: "male", key: "gender-male" },
              { label: "Female", value: "female", key: "gender-female" },
              {
                label: "Genderless",
                value: "genderless",
                key: "Gender-genderless",
              },
              { label: "Unknown", value: "unknown", key: "gender-unknown" },
            ],
            key: "gender-options",
          },
        ]}
      />
    </div>
  );
};

export default SelectRick;
